	@Inject
	public MycnlGrammarAccess(GrammarProvider grammarProvider,
			XbaseGrammarAccess gaXbase,
			XtypeGrammarAccess gaXtype) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaXbase = gaXbase;
		this.gaXtype = gaXtype;
		this.pDomainModel = new DomainModelElements();
		this.pModel = new ModelElements();
		this.pQuery = new QueryElements();
		this.pShowRegion = new ShowRegionElements();
		this.pFindtempBuilAction = new FindtempBuilActionElements();
		this.pCaltreesBuildAction = new CaltreesBuildActionElements();
		this.pDesignResidential = new DesignResidentialElements();
		this.pFindtempDemolish = new FindtempDemolishElements();
		this.pFindtempPlantTrees = new FindtempPlantTreesElements();
		this.pFindtempCutTrees = new FindtempCutTreesElements();
		this.pFindtempPlantBushes = new FindtempPlantBushesElements();
		this.pFindtempRemoveBushes = new FindtempRemoveBushesElements();
		this.pFindtempCreateLake = new FindtempCreateLakeElements();
		this.pFindtempRemoveLake = new FindtempRemoveLakeElements();
		this.pDesignCommercial = new DesignCommercialElements();
		this.pDesignEducational = new DesignEducationalElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.Mycnl".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
